import React from "react";
import { Mood } from "../types";

export function Sammy({ mood = "calm" }: { mood: Mood }): JSX.Element {
  switch (mood) {
    case "calm":
      return (
        <img
          src="data:image/png;base64,"
          alt="Sammy"
        ></img>
      );
    case "lazer":
      return (
        <img
          src="data:image/png;base64,"
          alt="Angry Sam"
        ></img>
      );
    case "cool":
      return (
        <img
          src="data:image/png;base64,"
          alt="Cool Sam"
        ></img>
      );
  }
}
